$darkshade: #1F2041;
$darkshade75: rgba(31, 32, 65, 0.75);
$darkshade5: rgba(31, 32, 65, 0.5);
$darkshade25: rgba(31, 32, 65, 0.25);
$darkshade05: rgba(31, 32, 65, 0.05);
$purple: #BC9CFF;
$green: #6FCF97;
h1{
    font-weight: 700;
    font-size: 24px;
    line-height: calc(29 / 24 * 100%);
}
h2{
    font-weight: 700;
    font-size: 19px;
    line-height: calc(23 / 19 * 100%);
}
h3 {
    font-weight: 700;
    font-size: 12px;
    line-height: calc(15 / 12 * 100%);
    text-transform: uppercase;
}
.color {
    background: #ffffff;
    // .color__container
    &__container {
        padding: 0 140px 145px;
        display: flex;
        justify-content: space-between;
        margin-bottom: 40px;
    }
    // .color__block-title
    &__block-title {
        flex: 0 0 436px;
    }
}
.block-color {
    display: flex;
    margin-bottom: 20px;
    &:last-child{
        margin-bottom: 0;
    }
    &-first{
        width: 70px;
        height: 70px;
        border-radius: 6px;
        margin-right: 40px;
        background-color: $darkshade;
    }
    &-second{
        width: 70px;
        height: 70px;
        border-radius: 6px;
        margin-right: 40px;
        background-color: $darkshade75;
    }
    &-third{
        width: 70px;
        height: 70px;
        border-radius: 6px;
        margin-right: 40px;
        background-color: $darkshade5;
    }
    &-fourth{
        width: 70px;
        height: 70px;
        border-radius: 6px;
        margin-right: 40px;
        background-color: $darkshade25;
    }
    &-fifth{
        width: 70px;
        height: 70px;
        border-radius: 6px;
        margin-right: 40px;
        background-color: $darkshade05;
    }
    &-sixth{
        width: 70px;
        height: 70px;
        border-radius: 6px;
        margin-right: 40px;
        background-color: $purple;
    }
    &-seventh{
        width: 70px;
        height: 70px;
        border-radius: 6px;
        margin-right: 40px;
        background-color: $green;
    }
    // .block-color__body
    &__body_s {
    }
    // .block-color__body-name
    &__body-name {
        font-weight: 700;
        font-size: 19px;
        line-height: calc(28  / 19 * 100%);
        color: $darkshade;
    }
    // .block-color__body-number
    &__body-number {
        font-weight: 400;
        font-size: 19px;
        line-height: calc(28  / 19 * 100%);
        color: $darkshade;
    }
}
.block-title {
    display: flex;
    margin-bottom: 51px;
    &:last-child {
        margin-bottom: 0;
    }
    & span {
        color: rgba(31, 32, 65, 0.25);
        font-weight: 400;
        width: 30px;
        height: 30px;
        text-align: right;
        margin-right: 30px;
    }
    &:first-child span{
        font-size: 24px;
        line-height: calc(29 / 24 * 100%);
    }
    &:nth-child(2) span{
        font-size: 19px;
        line-height: calc(23 / 19 * 100%);
    }
    &:nth-child(3) span{
        font-size: 12px;
        line-height: calc(15 / 12 * 100%);
    }
    &:last-child span{
        font-size: 14px;
        line-height: calc(24 / 14 * 100%);
    }
    & p{
        font-weight: 400;
        font-size: 14px;
        line-height: calc(24 / 14 * 100%);
        color: rgba(31, 32, 65, 0.75);
    }
}

