        top: -3px;
        right: 12px;
        color: #8BA4F9;
        font-size: 24px;
    }
    &_hd {
        top: -4px;
        right: -23px;
    }
    &_white {
        top: 23%;
        color: #ffffff;
        &:hover{
            opacity: 1;
        }
    }
    &_pagination {
        top: 7px;
        left: 2px;
        color: #ffffff;
    }
    &_img-left {
        transform: rotate(90deg);
        top: 42%;
        right: 88%;
        color: #FFFFFF;
    }
    &_img-right {
        transform: rotate(-90deg);
        top: 42%;
        right: 4%;
        color: #FFFFFF;
    }
}
.icons-block {
    display: flex;
    align-items: center;
    margin-bottom: 40px;
    position: relative;
    &__img {
        position: relative;
        width: 48px;
        height: 48px;
        margin-right: 10px;
    }
    &__body {
        & p:first-child {
            font-weight: 700;
            font-size: 14px;
            line-height: 24px;
            color: rgba(31, 32, 65, 0.75);
        }
        & p:last-child {
            font-weight: 400;
            font-size: 14px;
            line-height: 24px;
            color: rgba(31, 32, 65, 0.75);
        }
        &::after {
            content:"";
            position: absolute;
            top: 65px;
            left: 0;
            width: 280px;
            height: 1px;
            background: rgba(31, 32, 65, 0.1);
        }
    }
}
.checkbox-buttons_position{
    margin-bottom: 17px;
    &-star {
        margin-bottom: 10px;
    }
}
.range-slider_position{
    margin-bottom: 20px;
}
.review {
    display: flex;
    & img {
        margin-top: -11px;
        margin-left: -21px;
    }
    &__name {
        margin-left: -10px;
        font-weight: 400;
        font-size: 14px;
        line-height: 24px;
        color: rgba(31, 32, 65, 0.75);
        & p {
            font-weight: 700;
        }
    }
    &__body {
        display: flex;
        & p {
            margin-top: -6px;
            font-weight: 400;
            font-size: 14px;
            line-height: 24px;
            color: rgba(31, 32, 65, 0.75);
        }
    }
    &__block {
        margin-right: 14px;
    }
}
.button-position {
    margin: 0 23px 30px 1px;
}
.button-position_sec {
    margin: 0 18px 30px 0px;
}
.button-position_th {
    margin-right: 20px;
}
.button {
    &-click{
        font-weight: 700;
        font-size: 12px;
        line-height: 15px;
        text-transform: uppercase;
        color: #FFFFFF;
        background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
        border-radius: 22px;
        padding: 14px 21px 15px 19px;
        &_active {
            font-weight: 700;
            font-size: 12px;
            line-height: 15px;
            text-transform: uppercase;
            color: #FFFFFF;
            background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
            border-radius: 22px;
            opacity: 0.5;
            padding: 14px 21px 15px 19px;
            cursor:not-allowed;
        }
        &-sec {
            font-weight: 700;
            font-size: 12px;
            line-height: 15px;
            text-transform: uppercase;
            color: #BC9CFF;
            border: 2px solid #BC9CFF;
            border-radius: 22px;
            background: #ffffff;
            padding: 14px 20px 15px;
            &_active {
                font-weight: 700;
                font-size: 12px;
                line-height: 15px;
                text-transform: uppercase;
                color: #BC9CFF;
                border: 2px solid #BC9CFF;
                border-radius: 22px;
                background: #ffffff;
                opacity: 0.5;
                padding: 14px 20px 15px;
                cursor:not-allowed;
            }
        }
        &_th {
            font-weight: 700;
            font-size: 12px;
            line-height: 15px;
            text-transform: uppercase;
            color: #BC9CFF;
            background:#ffffff;
            &_active{
                cursor:not-allowed;
                font-weight: 700;
                font-size: 12px;
                line-height: 15px;
                text-transform: uppercase;
                color: rgba(31, 32, 65, 0.5);
                background:#ffffff;
            }
        }
    }
}
.button-pay {
    max-width: 320px;
    & a {
        background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
        border-radius: 22px;
        font-weight: 700;
        font-size: 12px;
        line-height: 15px;
        text-align: center;
        text-transform: uppercase;
        color: #FFFFFF;
        padding: 14px 0px 15px;
    }
    &__link {
        display: block;
        position: relative;
        &:hover{
            opacity: 0.8;
        }
    }
}
.bullet-list {
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    color: rgba(31, 32, 65, 0.75);
    & li {
        margin:0 0 0 21px;
        position: relative;
        &::before {
            content: "";
            position: absolute;
            height: 10px;
            width: 10px;
            top: 7px;
            right: 245px;
            border-radius: 100%;
            background: rgba(31, 32, 65, 0.25);
        }
    }
}
.pagination {
    &__body {
        font-weight: 400;
        font-size: 12px;
        line-height: 40px;
        color: rgba(31, 32, 65, 0.5);
        margin-bottom: 11px;
        & button {
            display: inline-block;
            align-items: center;
            text-align: center;
            width: 40px;
            height: 40px;
            background: #ffffff;
            &:first-child{
                color: #fff;
                background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
                border-radius: 22px;
            }
            &:last-child {
                position: relative;
                padding-top: 10px;
                background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
                border-radius: 22px;
            }
        } 
    }
    &__count {
        font-size: 14px;
        line-height: 24px;
        color: rgba(31, 32, 65, 0.75);
    }
}
//style slider
#slider .noUi-handle{
    width: 12px;
    height: 12px;
    border: 2px solid #FFFFFF;
    border-radius: 50%;
    top: -5px;
    left: 260px;
}
#slider {
    height: 6px;
    cursor: pointer;
}
.slider-styled .noUi-handle::before,
.slider-styled .noUi-handle::after {
    display: none;
}
.slider-styled .noUi-touch-area {
    border-radius: 50%;
    background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
    cursor: pointer;
}
//--------------------//

